      <span className="navbar-toggler-icon"></span>
    </button>
    <div className="collapse navbar-collapse" id="navbarSupportedContent">
      <ul className="navbar-nav me-auto mb-2 mb-lg-0">

      </ul>
<button onClick={openNav}>open</button>
<button onClick={closeNav}>open</button>



      <li className="nav-item dropdown">
          <a className="nav-link dropdown-toggle mb-4" href="#" id="navbarDropdown" role="button" data-bs-toggle="dropdown" aria-expanded="false">
          <i className="bi bi-person-fill"></i>
          </a>
          <ul className="dropdown-menu dropdown-menu-end" aria-labelledby="navbarDropdown">
            <li><Link className="dropdown-item "  onClick={logout}><i class="bi bi-gear mt-5"></i>Logout</Link></li>
          </ul>
        </li>
    </div>
  </div>
</nav>
    </div>
  )
}
